import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div style={{ paddingTop: '80px', minHeight: '100vh', background: '#0a0a0a' }}>
        <Home />
      </div>
    </div>
  );
}

export default App;
